import { Container, Form, Button } from 'react-bootstrap';

function BlockNum() {
    return (
        <Form.Group>
            <Form.Label>
                Block Number:
            </Form.Label>
            <Form.Control
                type="number"
                ref={(input) =>
                    console.log(input)
                }
                value = {'Hello World'}
            />
        </Form.Group>
    )
}

export default BlockNum;
